import { Fragment } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Main } from "./pages/Main";
import { NowPlayingPage } from "./pages/NowPlayingPage";
import { PopularPage } from "./pages/PopularPage";
import { UpComing } from "./pages/UpComing";
import { TopRatedPage } from "./pages/TopRatedPage";

export const Router = () => {
  return (
    <Fragment>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Main />} /> // 메인
          <Route path="/nowplaying" element={<NowPlayingPage />} /> // 현재
          상영작
          <Route path="/popular" element={<PopularPage />} /> // 인기 상영장
          <Route path="/upcoming" element={<UpComing />} /> // 개봉 예정
          <Route path="/toprated" element={<TopRatedPage />} /> // 별점순
        </Routes>
      </BrowserRouter>
    </Fragment>
  );
};
